//# sourceMappingURL=bootstrap.bundle.min.js.map
document.addEventListener("DOMContentLoaded", function () {
  const form = document.getElementById("contactForm");
  const msg = document.getElementById("formMsg");

  if (!form) {
    console.warn("Form element not found!");
    return;
  }

  form.addEventListener("submit", async function (e) {
    e.preventDefault();

    msg.innerHTML = "<div class='alert alert-info'>  ...</div>";

    try {
      const response = await fetch(form.action, {
        method: form.method,
        body: new FormData(form),
        headers: { Accept: "application/json" },
      });

      //      JSON
      const text = await response.text();

      if (response.ok || text.includes('"ok":true')) {
        msg.innerHTML = "<div class='alert alert-success'>    !</div>";
        form.reset();
      } else {
        msg.innerHTML = "<div class='alert alert-danger'>    .   .</div>";
        console.error("Response:", text);
      }
    } catch (err) {
      msg.innerHTML = "<div class='alert alert-warning'>    .       .</div>";
      console.error("Fetch Error:", err);
    }
  });
});